def predict(triples: list[Triple]) -> str:
    sentence = ""
    subject = ""
    for i, triple in enumerate(triples):
        if i == 0:
            subject = triple.subject
            if triple.predicate == "alternativeName":
                sentence += f"{subject} is also known as {triple.object}."
            elif triple.predicate == "creator":
                sentence += f"{subject} was created by {triple.object}."
            elif triple.predicate == "fullName":
                sentence += f"{subject}'s full name is {triple.object}."
            else:
                sentence += f"{subject} {triple.predicate} {triple.object}."
        else:
            if triple.predicate == "alternativeName":
                sentence += f" who is also known as {triple.object}"
            elif triple.predicate == "creator":
                sentence += f" who was created by {triple.object}"
            elif triple.predicate == "fullName":
                sentence += f" whose full name is {triple.object}"
            elif triple.predicate == "birthPlace":
                sentence += f", who was born in {triple.object}"
            elif triple.predicate == "nationality":
                sentence += f" and is of {triple.object} nationality"
            elif triple.predicate == "award":
                sentence += f" and won the {triple.object} award"
            else:
                sentence += f" and {triple.predicate} is {triple.object}."
    return sentence.strip(",.")

